import React from 'react';
import './slider.css'
const slider = (props) => {
    return ( 
        <div className="slidecontainer">
        <input type="range" min="0" max="100" value={props.range} className="slider" id="myRange" onChange={(event) => props.draggged(event)}/>
        <span id="output">{props.range}</span>
      </div>
     );
}

export default slider;
